  12,\n\t\"tags\": [],\n\t\"title\": \"Temperature profile and other data collected
  using bottle and CTD casts from NOAA Ship DAVID STARR JORDAN and other platforms
  from Coastal Waters of California during the California Cooperative Fisheries Investigation
  (CALCOFI) project, 1985-02-19 to 1985-11-14 (NCEI Accession 8700010)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-10-04T02:24:20.394984\",\n\t\"name\": \"temperature-profile-and-other-data-collected-using-bottle-and-ctd-casts-from-the-noaa-ship-davi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Oceanographic Station Data, temperature,
  and other data were collected using CTD and bottle casts from NOAA Ship DAVID STARR
  JORDAN, NOAA Ship McARTHUR, and NEW HORIZON from the Coastal Waters of California
  from February 19, 1985 to November 14, 1985. Data were submitted by Scripps Institution
  of Oceanography as part of the California Cooperative Fisheries Investigation (CALCOFI)
  project. Data were processed by NODC to the NODC standard Oceanographic Station
  Data (SD2) and the Universal Bathythermograph Output (UBT) formats. Full format
  descriptions are available at nodc.noaa.gov/.nnThe Oceanographic Station Data format
  contains physical-chemical oceanographic data recorded at discrete depth levels.
  Most of the observations were made using multi-bottle Nansen casts or other types
  of water samplers. A small amount (about 5 percent) were obtained using electronic
  CTD (conductivity-temperature-depth) or STD (salinity-temperature-depth) recorders.
  The CTD/STD data were reported to NODC at depth levels equivalent to Nansen cast
  data, however, and have been processed and stored the same as the Nansen data. Cruise
  information (e.g., ship, country, institution), position, date, and time, and reported
  for each station. The principal measured parameters and temperature and salinity
  , but dissolved oxygen, phosphate, total phosphorus, silicate, nitrate, nitrite,
  and pH may be reported. Meteorological conditions at the time of the cast (e.g.,
  air temperature and pressure, wind, waves) may also be reported, as well as auxiliary
  data such as water color (Forel-Ule scale), water transparency (Secchi disk depth),
  and depth to bottom. Values of density (sigma-t) sound velocity, and dynamic depth
  anomaly are computed from measured parameters. Each station contains the measurements
  taken at the observed depth levels, but also includes data values interpolated to
  a set of standard depth levels.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
